import { Component, OnInit, OnDestroy } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';

import { NgbActiveModal, NgbModal, NgbModalRef } from '@ng-bootstrap/ng-bootstrap';
import { JhiEventManager } from 'ng-jhipster';

import { ILinhaAerea } from 'app/shared/model/linha-aerea.model';
import { LinhaAereaService } from './linha-aerea.service';

@Component({
    selector: 'jhi-linha-aerea-delete-dialog',
    templateUrl: './linha-aerea-delete-dialog.component.html'
})
export class LinhaAereaDeleteDialogComponent {
    linhaAerea: ILinhaAerea;

    constructor(private linhaAereaService: LinhaAereaService, public activeModal: NgbActiveModal, private eventManager: JhiEventManager) {}

    clear() {
        this.activeModal.dismiss('cancel');
    }

    confirmDelete(id: number) {
        this.linhaAereaService.delete(id).subscribe(response => {
            this.eventManager.broadcast({
                name: 'linhaAereaListModification',
                content: 'Deleted an linhaAerea'
            });
            this.activeModal.dismiss(true);
        });
    }
}

@Component({
    selector: 'jhi-linha-aerea-delete-popup',
    template: ''
})
export class LinhaAereaDeletePopupComponent implements OnInit, OnDestroy {
    private ngbModalRef: NgbModalRef;

    constructor(private activatedRoute: ActivatedRoute, private router: Router, private modalService: NgbModal) {}

    ngOnInit() {
        this.activatedRoute.data.subscribe(({ linhaAerea }) => {
            setTimeout(() => {
                this.ngbModalRef = this.modalService.open(LinhaAereaDeleteDialogComponent as Component, { size: 'lg', backdrop: 'static' });
                this.ngbModalRef.componentInstance.linhaAerea = linhaAerea;
                this.ngbModalRef.result.then(
                    result => {
                        this.router.navigate([{ outlets: { popup: null } }], { replaceUrl: true, queryParamsHandling: 'merge' });
                        this.ngbModalRef = null;
                    },
                    reason => {
                        this.router.navigate([{ outlets: { popup: null } }], { replaceUrl: true, queryParamsHandling: 'merge' });
                        this.ngbModalRef = null;
                    }
                );
            }, 0);
        });
    }

    ngOnDestroy() {
        this.ngbModalRef = null;
    }
}
